(3, 'International Yoga Day', 'International Day of Yoga, or commonly and unofficially referred to as Yoga Day, is celebrated annually on 21 June since its inception in 2015. An international day for yoga was declared unanimously by the United Nations General Assembly (UNGA).[1] Yoga is a physical, mental and spiritual practice attributed mostly to India. The Indian Prime Minister Narendra Modi in his UN address suggested the date of 21 June, as it is the longest day of the year in the Northern Hemisphere and shares special significance in many parts of the world\r\n', 'International Day of Yoga, or commonly and unofficially referred to as Yoga Day, is celebrated annually on 21 June since its inception in 2015.', 'South Sikkim', 'Ravong', 'Block 2', 'Other Details such as building number  and pther details', 737111, 0, '2017-12-12', '2018-04-02', '2018-04-02', '2018-04-01', 0, 1, 1, 1, 0, 0, );
