(9, 'Swachh Bharat Abhiyan', 'Swachh Bharat Abhiyan (SBA) (or Swachh Bharat Mission (SBM) or Clean India Mission in English) is a campaign in India that aims to clean up the streets, roads and infrastructure of India''s cities, smaller towns, and rural areas. The objectives of Swachh Bharat include eliminating open defecation through the construction of household-owned and community-owned toilets and establishing an accountable mechanism of monitoring toilet use. Run by the Government of India, the mission aims to achieve an Open-Defecation Free (ODF) India by 2 October 2019, the 150th anniversary of the birth of Mahatma Gandhi, by constructing 90 million toilets in rural India at a projected cost of ?1.96 lakh crore (US$30 billion).[1] The mission will also contribute to India reaching Sustainable Development Goal Number 6 (SDG 6).', 'Swachh Bharat Abhiyan (SBA) (or Swachh Bharat Mission (SBM) or Clean India Mission in English) is a campaign in India that aims to clean up the streets, roads and infrastructure of India''s cities, smaller towns, and rural areas.', 'West Sikkim', 'Gyalsheng', 'Block 7', 'Specific Address Detailsl', 737201, 0, '2018-03-08', '2018-04-25', '2018-04-01', '2018-04-18', 1, 0, 1, 1, 0, 1, );
